import React, { useState, useEffect } from 'react';
import { View, Dimensions, Image } from 'react-native';
import Styles from '../config/Styles';

import { npsClienteLogo } from "../config/DataApp";
import InnerLoading from './InnerLoading';
import ColorsApp from '../config/ColorsApp';
import AsyncStorage from '@react-native-async-storage/async-storage';

import * as Device from 'expo-device';


export default function Header(props) {

    const screenWidth = Math.round(Dimensions.get('window').width);
    const screenHeight = Math.round(Dimensions.get('window').height);

    const [isLoaded, setIsLoaded] = useState(false);
    const [clienteLogo, setClienteLogo] = useState("132");

    
    const [deviceType, setDeviceType] = useState("")
    Device.getDeviceTypeAsync().then((v) => {
        setDeviceType(v)
    })

    const logoDefault = "data:image/png;base64,"


    const [orientation, setOrientation] = useState("PORTRAIT");

    useEffect(() => {

        Dimensions.addEventListener('change', ({ window: { width, height } }) => {

            if (width < height) {

                setOrientation("PORTRAIT")

            } else {

                setOrientation("LANDSCAPE")

            }
        })



    }, []);


    useEffect(() => {

        const getItemFromStorage = async () => {

            await AsyncStorage.getItem('auth', (error, result) => {

                var data = JSON.parse(result)

                AsyncStorage.getItem('codCliente', (error, codCliente) => {


                    var codCliente = parseInt(codCliente)

                    npsClienteLogo(data.token, codCliente).then((logoFile) => {

                

                        try {

                            console.log("[!] Pegando Imagem do Cliente")
                            console.log(logoFile.nomeImagem)

                            if (!logoFile.imagem) {

                            

                                setClienteLogo(logoDefault)

                            } else {

                                setClienteLogo('data:image/png;base64,'+logoFile.imagem)
                                // setIsLoaded(true)
                            }
           

                          

                        } catch (error) {

                            // console.log(error)
                            console.log('npsClienteLogo estão incorretas.')

                        }

                    }).catch((error) => {

                        console.log("npsClienteLogo(data.token).then((response) => {")

                    })
                })
            })
        }

        getItemFromStorage()


        setIsLoaded(true);

    }, []);


    if (!isLoaded) {
        return (
            <InnerLoading />
        );
    }

    if (isLoaded) {
        if (orientation == "PORTRAIT") {

            return (

                <View >
                    <View style={{ width: '100%', backgroundColor: ColorsApp.BACK, margin: 'auto', marginTop: 5, borderBottomColor: '#d1d1d1', borderBottomWidth: 1 }}>
                        <View style={{ flexDirection: 'row', justifyContent: 'center', marginTop: 5, marginBottom: 5 }}>
                            <Image resizeMode={"contain"} source={{ uri: clienteLogo }} style={deviceType != 1 ? Styles.ImageHeaderTablet : Styles.ImageHeader} ></Image>
                        </View>
                    </View>
                </View>
    
            );

        } else {

            return (

                <View >
                    <View style={{ width: '100%', backgroundColor: ColorsApp.BACK, margin: 'auto', marginTop: 5, borderBottomColor: '#d1d1d1', borderBottomWidth: 1 }}>
                        <View style={{ flexDirection: 'row', justifyContent: 'center', marginTop: 5, marginBottom: 5 }}>
                            <Image resizeMode={"contain"} source={{ uri: clienteLogo }} style={deviceType != 1 ? Styles.LANDImageHeaderTablet : Styles.LANDImageHeader} ></Image>
                        </View>
                    </View>
                </View>
    
            );

        }
       
    }
}